<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

<script>(function() {
  // If window.HTMLWidgets is already defined, then use it; otherwise create a
  // new object. This allows preceding code to set options that affect the
  // initialization process (though none currently exist).
  window.HTMLWidgets = window.HTMLWidgets || {};

  // See if we're running in a viewer pane. If not, we're in a web browser.
  var viewerMode = window.HTMLWidgets.viewerMode =
      /\bviewer_pane=1\b/.test(window.location);

  // See if we're running in Shiny mode. If not, it's a static document.
  // Note that static widgets can appear in both Shiny and static modes, but
  // obviously, Shiny widgets can only appear in Shiny apps/documents.
  var shinyMode = window.HTMLWidgets.shinyMode =
      typeof(window.Shiny) !== "undefined" && !!window.Shiny.outputBindings;

  // We can't count on jQuery being available, so we implement our own
  // version if necessary.
  function querySelectorAll(scope, selector) {
    if (typeof(jQuery) !== "undefined" && scope instanceof jQuery) {
      return scope.find(selector);
    }
    if (scope.querySelectorAll) {
      return scope.querySelectorAll(selector);
    }
  }

  function asArray(value) {
    if (value === null)
      return [];
    if ($.isArray(value))
      return value;
    return [value];
  }

  // Implement jQuery's extend
  function extend(target /*, ... */) {
    if (arguments.length == 1) {
      return target;
    }
    for (var i = 1; i < arguments.length; i++) {
      var source = arguments[i];
      for (var prop in source) {
        if (source.hasOwnProperty(prop)) {
          target[prop] = source[prop];
        }
      }
    }
    return target;
  }

  // IE8 doesn't support Array.forEach.
  function forEach(values, callback, thisArg) {
    if (values.forEach) {
      values.forEach(callback, thisArg);
    } else {
      for (var i = 0; i < values.length; i++) {
        callback.call(thisArg, values[i], i, values);
      }
    }
  }

/**
 * @fileoverview
 * Including this file will add several additional shapes to Dygraph.Circles
 * which can be passed to drawPointCallback.
 * See tests/custom-circles.html for usage.
 */

(function() {

/**
 * @param {!CanvasRenderingContext2D} ctx the canvas context
 * @param {number} sides the number of sides in the shape.
 * @param {number} radius the radius of the image.
 * @param {number} cx center x coordate
 * @param {number} cy center y coordinate
 * @param {number=} rotationRadians the shift of the initial angle, in radians.
 * @param {number=} delta the angle shift for each line. If missing, creates a
 *     regular polygon.
 */
var regularShape = function(
    ctx, sides, radius, cx, cy, rotationRadians, delta) {
  rotationRadians = rotationRadians || 0;
  delta = delta || Math.PI * 2 / sides;

  ctx.beginPath();
  var initialAngle = rotationRadians;
  var angle = initialAngle;

  var computeCoordinates = function() {
    var x = cx + (Math.sin(angle) * radius);
    var y = cy + (-Math.cos(angle) * radius);
    return [x, y];
  };

  var initialCoordinates = computeCoordinates();
  var x = initialCoordinates[0];
  var y = initialCoordinates[1];
  ctx.moveTo(x, y);

  for (var idx = 0; idx < sides; idx++) {
    angle = (idx == sides - 1) ? initialAngle : (angle + delta);
    var coords = computeCoordinates();
    ctx.lineTo(coords[0], coords[1]);
  }
  ctx.fill();
  ctx.stroke();
};

/**
 * TODO(danvk): be more specific on the return type.
 * @param {number} sides
 * @param {number=} rotationRadians
 * @param {number=} delta
 * @return {Function}
 * @private
 */
var shapeFunction = function(sides, rotationRadians, delta) {
  return function(g, name, ctx, cx, cy, color, radius) {
    ctx.strokeStyle = color;
    ctx.fillStyle = "white";
    regularShape(ctx, sides, radius, cx, cy, rotationRadians, delta);
  };
};

var customCircles = {
  TRIANGLE : shapeFunction(3),
  SQUARE : shapeFunction(4, Math.PI / 4),
  DIAMOND : shapeFunction(4),
  PENTAGON : shapeFunction(5),
  HEXAGON : shapeFunction(6),
  CIRCLE : function(g, name, ctx, cx, cy, color, radius) {
    ctx.beginPath();
    ctx.strokeStyle = color;

            } else if (event.axis == "y") {
              yPos = g.toDomYCoord(event.pos);
              
              thiz.dashedLine(canvas, 
                              area.x, 
                              yPos, 
                              area.x + area.w, 
                              yPos,
                              event.strokePattern);
            }
            canvas.restore();
            
            // draw label
            if (event.label != null) {
              canvas.save();
              thiz.setFontSize(canvas, 12);
              var size = canvas.measureText(event.label);
              if (event.axis == "x") {
                var tx = xPos - 4;
                var ty;
                if (event.labelLoc == "top")
                  ty = area.y + size.width + 10;
                else
                  ty = area.y + area.h - 10;
                canvas.translate(tx, ty);
                canvas.rotate(3 * Math.PI / 2);
                canvas.translate(-tx,-ty);
              } else if (event.axis == "y") {
                var ty = yPos - 4;
                var tx;
                if (event.labelLoc == "right")
                  tx = area.x + area.w - size.width - 10;
                else
                  tx = area.x + 10;
              }
              canvas.fillStyle = event.color;
              canvas.fillText(event.label, tx, ty);
              canvas.restore();
            }
          }
        };
      },
      
      addDateWindowShinyInput: function(id, isDate) {
          
        // check for an existing drawCallback
        var prevDrawCallback = dygraph.getOption("drawCallback");
        
        // install the callback
        dygraph.updateOptions({
          drawCallback: function(me, initial) {
            // call existing
            if (prevDrawCallback)
              prevDrawCallback(me, initial);
            // fire input change
            var range = dygraph.xAxisRange();
            if (isDate)
              range = [new Date(range[0]), new Date(range[1])];
            if (Shiny.onInputChange) // may note be ready yet in case of static render
              Shiny.onInputChange(id + "_date_window", range); 
          }
        });
      },
      
      addClickShinyInput: function(id, isDate) {
        
        var prevClickCallback = dygraph.getOption("clickCallback")
        
        dygraph.updateOptions({
          clickCallback: function(e, x, points) {
            
            // call existing
            if (prevClickCallback)
              prevClickCallback(e, x, points);
              
			      // fire input change
			      if (Shiny.onInputChange) { // may note be ready yet in case of static render
              Shiny.onInputChange(el.id + "_click", {
        				x: isDate ? new Date(x) : x,
        				x_closest_point: isDate ? new Date(points[0].xval) : points[0].xval,
        				y_closest_point: points[0].yval,
        				series_name: points[0].name,
        				'.nonce': Math.random() // Force reactivity if click hasn't changed
  			      }); 
			      }
          }
        });
      },
      
      // Add dashed line support to canvas rendering context
      // See: http://stackoverflow.com/questions/4576724/dotted-stroke-in-canvas
      dashedLine: function(canvas, x, y, x2, y2, dashArray) {
        canvas.beginPath();
        if (!dashArray) dashArray=[10,5];
        if (dashLength==0) dashLength = 0.001; // Hack for Safari
        var dashCount = dashArray.length;
        canvas.moveTo(x, y);
        var dx = (x2-x), dy = (y2-y);
        var slope = dx ? dy/dx : 1e15;
        var distRemaining = Math.sqrt( dx*dx + dy*dy );
        var dashIndex=0, draw=true;
        while (distRemaining>=0.1){
          var dashLength = dashArray[dashIndex++%dashCount];
          if (dashLength > distRemaining) dashLength = distRemaining;
          var xStep = Math.sqrt( dashLength*dashLength / (1 + slope*slope) );
          if (dx<0) xStep = -xStep;
          x += xStep
          y += slope*xStep;
          canvas[draw ? 'lineTo' : 'moveTo'](x,y);
          distRemaining -= dashLength;
          draw = !draw;
        }
        canvas.stroke();
      },
      
      setFontSize: function(canvas, size) {
        var cFont = canvas.font;
        var parts = cFont.split(' ');
        if (parts.length === 2)
          canvas.font = size + 'px ' + parts[1];
        else if (parts.length === 3)
          canvas.font = parts[0] + ' ' + size + 'px ' + parts[2];
      },
      
      // Returns the value of a GET variable
      queryVar: function(name) {
        return decodeURI(window.location.search.replace(
          new RegExp("^(?:.*[&\\?]" +
                     encodeURI(name).replace(/[\.\+\*]/g, "\\$&") +
                     "(?:\\=([^&]*))?)?.*$", "i"),
          "$1"));
      },
      
      // We deal exclusively in UTC dates within R, however dygraphs deals 
      // exclusively in the local time zone. Therefore, in order to plot date
      // labels that make sense to the user when we are dealing with days,
      // months or years we need to convert the UTC date value to a local time
      // value that "looks like" the equivilant UTC value. To do this we add the
      // timezone offset to the UTC date.
      // Don't use in case of fixedtz
      normalizeDateValue: function(scale, value, fixedtz) {
        var date = new Date(value); 
        if (scale != "minute" && scale != "hourly" && scale != "seconds" && !fixedtz) {
          var localAsUTC = date.getTime() + (date.getTimezoneOffset() * 60000);
          date = new Date(localAsUTC);
        }
        return date;
      },
      
      // safely detect rendering on a mobile phone
      isMobilePhone: function() {
        try
        {
          return ! window.matchMedia("only screen and (min-width: 768px)").matches;
        }
        catch(e) {
          return false;
        }
      },
        
      
      resize: function(width, height) {
        if (dygraph)
          dygraph.resize();
      },
      
      // export dygraph so other code can get a hold of it
      dygraph: null
    
    };
  },
  
  // track groups globally
  groups: {}
  
});

<script>/**
 * @license
 * Copyright 2015 Petr Shevtsov (petr.shevtsov@gmail.com)
 * MIT-licensed (http://opensource.org/licenses/MIT)
 *
 * Ribbon is a horizontal band of colors that runs through the chart. It can be
 * useful to visualize categorical variables
 * (http://en.wikipedia.org/wiki/Categorical_variable) that change over time (along
 * the x-axis). For example multiple states of economy like "bust", "recession",
 * "recovery", "boom" can be encoded as [0, 1, 2, 3] respectively (or normalized as
 * [0, 0.33, 0.66, 1]) and assigned colors ["red","orange","green","purple"].
 *
 * Plugin options:
 *
 * `data`: Array of numeric values in the range from 0 to 1. Ribbon data array must
 * be of same length as number of rows of Dygraph raw data table.  Each of the values
 * (0-1) scales to a position in the palette array scale (see palette argument
 * below). For example, if palette is defined as ["transparent", "#ef2929",
 * "#8ae234"], then 0 is the leftmost position ("#ef2929") on the palette scale, 1 is
 * the rightmost position ("#8ae234") and 0.5 is the middle position ("#ef2929").
 *
 * `parser`: Function (function (data, dygraph)) returning the array of numeric
 * values.  Function arguments: raw data, dygraph instance. Provide it if the ribbon
 * data, i.e. encodings are part of the dygraph raw data table rather than supplied
 * separately through ribbon data argument.
 *
 * `options`: Object with the following properties:
 *
 *  - `palette`: array of hexadecimal color codes.
 *    Default: ["transparent", "#ef2929", "#8ae234"].
 *    Pick colors from e.g. http://www.w3schools.com/tags/ref_colorpicker.asp
 *
 *  - `top`: vertical position of the top edge of the ribbon relative to chart height.
 *    Value in the range from 0 (bottom edge of the chart) to 1 (top edge of the chart).
 *    E.g. 0.5 places the top edge of the ribbon at the 50% height of the chart.
 *
 *  - `bottom`: vertical position of the bottom edge of the ribbon relative to chart
 *    height. See top.
 */

/*global Dygraph:false */

Dygraph.Plugins.Ribbon = (function() {
  "use strict";

  var ribbon = function(options) {
    options = options || {};

    this.ribbonData_ = options.data || null;
    this.ribbonDataParser_ = options.parser || null;
    this.ribbonOptions_ = options.options || {};

    var defaultOptions = {
      palette: [
        "transparent",
        "#d9534f",
        "#5cb85c"
      ],
      top: 1,
      bottom: 0
    };

    function update(self, o) {
      if (typeof(o) != 'undefined' && o !== null) {
        for (var k in o) {
          if (o.hasOwnProperty(k) && o[k] !== null) {
            self[k] = o[k];
          }
        }
      }
      return self;
    }

    this.ribbonOptions_ = update(defaultOptions, this.ribbonOptions_);
    this.ribbonOptions_.top = Math.min(this.ribbonOptions_.top, 1);
    this.ribbonOptions_.top = Math.max(this.ribbonOptions_.top, 0);
    this.ribbonOptions_.bottom = Math.min(this.ribbonOptions_.bottom, 1);
    this.ribbonOptions_.bottom = Math.max(this.ribbonOptions_.bottom, 0);

    this.ribbonOptions_.top = Math.max(this.ribbonOptions_.top, this.ribbonOptions_.bottom);
    this.ribbonOptions_.bottom = Math.min(this.ribbonOptions_.top, this.ribbonOptions_.bottom);
  };

  ribbon.prototype.toString = function() {
    return "Ribbon Plugin";
  };

  ribbon.prototype.activate = function(g) {
    if (this.ribbonData_ !== null || this.ribbonDataParser_ !== null) {
      return {
        willDrawChart: this.willDrawChart
      };
    }
  };

  ribbon.prototype.decodeColor = function(val) {
    var max = Math.max.apply(null, this.ribbonData_);
    val = val / max;
    var idx = Math.ceil((this.ribbonOptions_.palette.length - 1) * val);

    return this.ribbonOptions_.palette[idx];
  };

  ribbon.prototype.willDrawChart = function(e) {
    var g = e.dygraph;
    var layout = g.layout_;
    var points = layout.points[0];
    var area = layout.getPlotArea();
    if (this.ribbonData_ === null) {
      this.ribbonData_ = this.ribbonDataParser_(g.rawData_, g);
    }
    for (var i = 0; i < points.length; i++) {
      var point = points[i];
      var nextpoint = points[i + 1];

      var left = g.toDomCoords(point.xval, 0)[0];
      var right = (nextpoint === undefined) ? g.canvas_.width : g.toDomCoords(nextpoint.xval, 0)[0];
      var color = (nextpoint === undefined) ? "transparent" : this.decodeColor(this.ribbonData_[point.idx]);
      var y = area.h * (1 - this.ribbonOptions_.top) + area.y;
      var h = (area.h - area.h * this.ribbonOptions_.bottom) - y;
      g.hidden_ctx_.fillStyle = color;
      g.hidden_ctx_.fillRect(left, y, right - left, h);
    }
  };

  return ribbon;
})();
</script>
<script>/**
 * @license
 * Copyright 2015 Petr Shevtsov (petr.shevtsov@gmail.com)
 * MIT-licensed (http://opensource.org/licenses/MIT)
 *
 * Rebase plugin
 *
 * On pan/zoom event, each series will rebase to a specified value (e.g. 100) at the
 * start of the displayed period.
 *
 * See http://stats.oecd.org/glossary/detail.asp?ID=2249
 *
 * Options:
 *  Value to rebase. Must be either Number or 'percent' or null.
 *
 */

/*global Dygraph:false */

(function() {

  "use strict";

  // Matches DefaultHandler.parseFloat
  var parseFloat = function(val) {
    if (val === null) return NaN;
    return val;
  };

  Dygraph.DataHandlers.RebaseHandler = function(baseOpt) {
    this.baseOpt = baseOpt;
  };

  var RebaseHandler =  Dygraph.DataHandlers.RebaseHandler;
  RebaseHandler.prototype = new Dygraph.DataHandlers.DefaultHandler();

  RebaseHandler.rebase = function(value, initial, base) {
    if (base === "percent") {
      return (value / initial - 1) * 100;
    }
    return value * base / initial;
  };

  RebaseHandler.prototype.getExtremeYValues = function(series, dateWindow, options) {
    var minY = null, maxY = null, y;
    var firstIdx = 0, lastIdx = series.length - 1;
    var initial = series[firstIdx][1];

    for (var j = firstIdx; j <= lastIdx; j++) {
      if (j === firstIdx) {
        y = (this.baseOpt === "percent") ? 0 : this.baseOpt;
      } else {
        y = RebaseHandler.rebase(series[j][1], initial, this.baseOpt);
      }
      if (y === null || isNaN(y))
        continue;
      if (maxY === null || y > maxY) {
        maxY = y;
      }
      if (minY === null || y < minY) {
        minY = y;
      }
    }
    return [ minY, maxY ];
  };

  RebaseHandler.prototype.seriesToPoints = function(series, setName, boundaryIdStart){
    var points = [];
    var firstIdx = 0;
    var lastIdx = series.length - 1;
    var initial = series[firstIdx][1]; // TODO: check for null
    for (var i = 0; i <= lastIdx; ++i) {
      var item = series[i];
      var yraw = item[1];
      var yval = yraw === null ? null : parseFloat(yraw);
      if (yval !== null) {
        if (i === firstIdx) {
          yval = (this.baseOpt === "percent") ? 0 : this.baseOpt;
        } else {
          yval = RebaseHandler.rebase(yval, initial, this.baseOpt);
        }
      }
      var point = {
        x: NaN,
        y: NaN,
        xval: parseFloat(item[0]),
        yval: yval,
        name: setName,
        idx: i + boundaryIdStart
      };
      points.push(point);
    }
    this.onPointsCreated_(series, points);
    return points;
  };

  Dygraph.Plugins.Rebase = (function() {
    var rebase = function(baseOpt) {
      var isNum = function(v) {
        return !isNaN(v) && (typeof v === 'number' || {}.toString.call(v) === '[object Number]');
      };
      if (baseOpt === "percent" || isNum(baseOpt)) {
        this.baseOpt_ = baseOpt;
      } else {
        this.baseOpt_ = null;
      }
    };

    rebase.prototype.toString = function() {
      return "Rebase Plugin";
    };

    rebase.prototype.activate = function(g) {
      if (this.baseOpt_ === null) {
        return;
      }
      return {
        predraw: this.predraw
      };
    };

    rebase.prototype.predraw = function(e) {
      var g = e.dygraph;

      if (this.baseOpt_ === "percent") {
        g.updateOptions({
          axes: {
            y: {
              axisLabelFormatter: function(y) {
                return y + '%';
              },
              valueFormatter: function(y) {
                return Math.round(y * 100) / 100 + '%';
              }
            }
          }
        }, true);
      }

      g.dataHandler_ = new Dygraph.DataHandlers.RebaseHandler(this.baseOpt_);
    };

    return rebase;
  })();
})();
</script>
